import { Link, useNavigate } from 'react-router-dom';
import { useEffect } from 'react';
import { adminApi, setAuthToken } from '../../api'; 


const AdminDashboard = () => {
    const navigate = useNavigate();
    const handleOpenDoctorRegistration = () => {
        
        navigate('/doctor-registration');};
    const handleOpenUnverifiedUserList = () => {
          
          navigate('/admin/unverified-users');};
      
  useEffect(() => {
    
    setAuthToken();

    // Example: Fetch admin data
    adminApi.getData()
      .then(response => {
        console.log('Admin data:', response.data);
      })
      .catch(error => {
        console.error('Error fetching admin data:', error);
      });
      

  }, []); 



  return (
    <div>
      <h1>Admin Dashboard</h1>
      <div>
      <button onClick={handleOpenDoctorRegistration}>Doctor Registration</button>
      </div>
      <button onClick={handleOpenUnverifiedUserList}>Unverified Users</button>  
    </div>
  );
};

export default AdminDashboard;
